import React from 'react'
import { useLocation } from 'react-router-dom';

export default function CostumerDetails(props) {

    const costumersArray = props.costumersArray;
    const location = useLocation();
    const {costumers} = location.state;
    
  return (
    <div>
      <p>{costumers.name}</p>
      <p>{costumers.id}</p>
      <p>{costumers.address}</p>
      <p>{costumers.phoneNumber}</p>
      <p>{costumers.plateNumber}</p>
    </div>
  );
}
